import { useState } from "react";
import { Button, Card, Form, Modal, Row } from "react-bootstrap";
import { useForm } from "react-hook-form";

import { Input } from "./Input";

export function Food(props) {
    const {
        handleSubmit,
        register,
        formState: { errors },
    } = useForm();
    const [isUpdated, setIsUpdated] = useState(false);

    async function editFood(data) {
        await props.editFood({ ...data, id: props.food.id });
        setIsUpdated(false);
    }

    return (
        <>
            <Card id="Cards" className="mb-custon p-custon bg-custon">
                <Card.Title id="chardss">
                    <strong>Nome: </strong>
                    {props.food.nome}
                    {props.food.Sobrenome}
                </Card.Title>
                <Card.Text id="chardssub">
                    <strong id="chardssub">Genero: H </strong>
                    {props.food.Genero} <strong id="chardssub">Local de trabalho: MICROSOFT</strong>
                    {props.food.LocalTrabalho}<strong id="chardssub">CRM: 384834</strong> {props.food.CRM}
                </Card.Text>
                <Row xs="auto"  className="d-flex">
                    <Button id="editeedele" onClick={() => setIsUpdated(true)}>
                        Editar
                    </Button>
                    <Button
                        id="editeedelet"
                        className="ms-3"
                        onClick={props.removeFood}
                    >
                        Apagar
                    </Button>
                </Row>
            </Card>
            <Modal show={isUpdated} onHide={() => setIsUpdated(false)}>
                <Modal.Header>
                    <Modal.Title>
                        Editar alimento: {props.food.nome}
                    </Modal.Title>
                </Modal.Header>
                <Form
                    noValidate
                    onSubmit={handleSubmit(editFood)}
                    validated={!!errors}
                >
                    <Modal.Body>
                        <Input
                            className="mb-3"
                            type="text"
                            defaultValue={props.food.nome}
                            label="Nome do alimento"
                            placeholder="Insira o nome do alimento"
                            required={true}
                            name="nameFood"
                            error={errors.nameFood}
                            validations={register("nameFood", {
                                required: {
                                    value: true,
                                    message: "Nome do alimento é obrigatório.",
                                },
                            })}
                        />
                        <Form.Group>
                            <Form.Label>Seleciona o estado</Form.Label>
                            <Form.Select
                                {...register("unity")}
                                defaultValue={props.food.unidadeMedida}
                            >
                                <option disabled>Clique para selecionar</option>
                                <option value={"Kilograma"}>MT</option>
                                <option value={"Grama"}>RS</option>
                                <option value={"Mililitro"}>SP</option>
                                <option value={"Litro"}>AM</option>
                            </Form.Select>
                        </Form.Group>
                    </Modal.Body>
                    <Modal.Footer>
                        <Button variant="primary" type="submit">
                            Editar
                        </Button>
                        <Button
                            variant="secondary"
                            onClick={() => setIsUpdated(false)}
                        >
                            Fechar
                        </Button>
                    </Modal.Footer>
                </Form>
            </Modal>
        </>
    );
}
